DROP TABLE IF EXISTS `tb_maintenance_request`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tb_maintenance_request` (
  `id_maintenance_request` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID ใบแจ้งซ่อม',
  `maintenance_request_no` varchar(20) NOT NULL COMMENT 'PCS-FM-IT-23-02-0001',
  `ref_id_dept_request` int(11) NOT NULL COMMENT 'REF.ไอดีแผนกแจ้งซ่อม',
  `ref_id_site_request` int(11) NOT NULL COMMENT 'REF.ไซต์งาน',
  `ref_id_dept_responsibility` int(11) NOT NULL COMMENT 'แผนกที่รับผิดชอบใบแจ้งซ่อม',
  `mt_request_date` datetime NOT NULL COMMENT 'วันที่แจ้งซ่อม',
  `ref_id_user_request` int(11) NOT NULL COMMENT 'REF.ไอดีผู้แจ้งซ่อม',
  `ref_id_machine_site` int(11) NOT NULL COMMENT 'REF.ไอดีเครื่องจักรรายไซต์',
  `ref_id_mt_type` int(11) NOT NULL COMMENT 'REF.อ้างอิงประเภทใบงาน',
  `status_approved` int(11) DEFAULT NULL COMMENT '1-อนุมัติซ่อม / 2-ไม่อนุมัติ(หน.ช่าง)',
  `ref_id_user_approver` int(11) NOT NULL COMMENT 'REF.ไอดีผู้อนุมัติใบแจ้งซ่อม',
  `detail_note_approved` varchar(150) DEFAULT NULL,
  `allotted_date` datetime DEFAULT NULL COMMENT 'วันที่อนุมัติ/จ่ายงานให้ผู้ซ่อม',
  `allotted_accept_date` datetime DEFAULT NULL COMMENT 'วันที่ผู้ซ่อม(ช่าง)รับงาน',
  `ref_user_id_accept_request` int(11) DEFAULT NULL COMMENT 'REF.ไอดีผู้กดรับงาน',
  `related_to_safty` int(11) DEFAULT NULL COMMENT 'เกี่ยวข้องกับความปลอดภัย 	1-ไม่เกี่ยวข้อง/2-เกี่ยวข้อง',
  `problem_statement` longtext DEFAULT NULL COMMENT 'อาการเสีย,ปัญหาที่พบ',
  `ref_id_job_type` int(11) DEFAULT NULL COMMENT 'ประเภทงานซ่อม1-แจ้งช่างซ่อม/2-ช่างซ่อมเอง/3-ส่งซ่อมภายนอก',
  `urgent_type` int(11) NOT NULL COMMENT '1-ด่วน/2-ไม่ด่วน',
  `outsource_service_status` int(11) DEFAULT NULL COMMENT '0, 1-ส่งซ่อมภายนอก/ แจ้งช่างซ่อม',
  `caused_by_os` longtext DEFAULT NULL COMMENT 'สาเหตุที่ส่งซ่อม 		เหตุผล:|:รายละเอียด / คั่นด้วย :|:',
  `ref_id_user_approve_os` int(11) DEFAULT NULL COMMENT 'ผู้อนุมัติส่งซ่อมภายนอก',
  `duration_serv_start` datetime DEFAULT NULL COMMENT 'เวลาที่เริ่มซ่อม',
  `duration_serv_end` datetime DEFAULT NULL COMMENT 'เวลาที่ซ่อมเสร็จ',
  `estimate_hand_over_date` datetime DEFAULT NULL COMMENT 'วันที่คาดว่าจะเสร็จส่งมอบ',
  `hand_over_date` datetime DEFAULT NULL COMMENT 'วันที่ส่งมอบงาน',
  `recomment` longtext DEFAULT NULL,
  `ref_id_user_survey` int(11) DEFAULT NULL COMMENT 'REF.ไอดีผู้ประเมิณ(ผู้แจ้งซ่อม)',
  `survay_date` datetime DEFAULT NULL,
  `ref_id_user_hand_over` int(11) DEFAULT NULL COMMENT 'REF.ไอดีผู้ส่งมอบงาน',
  `cause_mt_request_cancel` longtext DEFAULT NULL COMMENT 'สาเหตุการยกเลิก',
  `date_mt_request_cancel` datetime DEFAULT NULL COMMENT 'วันที่ยกเลิก',
  `ref_id_user_cancel` int(11) DEFAULT NULL,
  `maintenance_request_status` int(11) NOT NULL COMMENT 'สถานะใบแจ้งซ่อม 1-ใช้งาน,2-ยกเลิก',
  PRIMARY KEY (`id_maintenance_request`),
  KEY `maintenance_request_no` (`maintenance_request_no`)
) ENGINE=InnoDB AUTO_INCREMENT=689 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='ตารางใบแจ้งซ่อม';
/*!40101 SET character_set_client = @saved_cs_client */;

